DROP TABLE IF EXISTS `ptm_booth_info`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `ptm_booth_info` (
  `BOOTH_ID` int(11) NOT NULL DEFAULT '0',
  `BOOTH_NAME` varchar(50) NOT NULL,
  `TECHNICIAN` varchar(20) DEFAULT NULL,
  `STATUS` varchar(10) NOT NULL DEFAULT 'WORKING',
  `LOC_DETAIL` varchar(50) DEFAULT NULL,
  `LOC_STREET_NO` varchar(100) NOT NULL,
  `LOC_SUBURB` varchar(50) NOT NULL,
  `LOC_STATE` varchar(20) NOT NULL,
  `LOC_POSTCD` varchar(10) NOT NULL,
  `GROUP_ID` int(11) NOT NULL,
  `MANAGER` varchar(20) DEFAULT NULL,
  `SERIAL_NO` varchar(30) NOT NULL,
  `PRINTER_MODEL` varchar(30) DEFAULT NULL,
  `CAPTURE_TYPE` varchar(30) DEFAULT NULL,
  `PAD_LOCK` varchar(50) DEFAULT NULL,
  `INSIDE_LOCK` varchar(30) DEFAULT NULL,
  `TAG_DUE_DT` varchar(10) DEFAULT NULL,
  `QUALITY_TEST_RESULT` varchar(10) DEFAULT 'PASS',
  `QUALITY_TEST_DT` varchar(10) DEFAULT NULL,
  `TYPE` varchar(30) DEFAULT NULL,
  `BOOTH_COMMENT` varchar(1000) DEFAULT NULL,
  `MONITOR_TYPE` varchar(30) DEFAULT NULL,
  `UPDATE_DT` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `RENT_FEE_TYPE` varchar(11) NOT NULL,
  `PAY_ONSITE` varchar(2) NOT NULL DEFAULT 'N',
  `USE_YN` varchar(2) NOT NULL DEFAULT 'Y',
  PRIMARY KEY (`BOOTH_ID`),
  KEY `ptm_booth_info_ibfk_1` (`GROUP_ID`),
  KEY `ptm_booth_info_ibfk_3` (`TECHNICIAN`),
  KEY `ptm_booth_info_ibfk_2` (`MANAGER`),
  CONSTRAINT `ptm_booth_info_ibfk_1` FOREIGN KEY (`GROUP_ID`) REFERENCES `ptm_booth_group` (`GROUP_ID`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `ptm_booth_info_ibfk_2` FOREIGN KEY (`MANAGER`) REFERENCES `frwk_cmm_userinfo` (`USER_ID`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `ptm_booth_info_ibfk_3` FOREIGN KEY (`TECHNICIAN`) REFERENCES `frwk_cmm_userinfo` (`USER_ID`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

